import { useEffect, useState } from "react";
import { Navigate } from "react-router-dom";
import door from '../images/door.png';

const Moria = ({token}) => {
    //implement token axios post request
    <link href="//db.onlinewebfonts.com/c/b0702a2a2bb6243e03bb4f9771b22aa1?family=LORD+OF+THE+RING" rel="stylesheet" type="text/css"/>
    return (
        <div  className=" flex w-full justify-center items-center  bg-gradient-to-r from-slate-500 to-blue-900">
            <div className="md:flex justify-center">
                <img src={door}  alt="" className="w-90 cursor-pointer"/>
            </div>
            <h1>Well done</h1>
        </div>
    )
};

export default Moria;
